import React, {Component} from 'react';
import axios from 'axios';

export default class MeBhe extends Component {

    constructor(props) {
        super(props);

        this.state = {products:[]};
    }

    componentDidMount(){
        axios.get("http://localhost:4000/me/bhe")
             .then(res => console.log(res.body));   
    }

    render() {
        return (
            <div>
                Meow
            </div>
        )
    }
}
